import axios from "axios";

const CategoryList = async () => {
  const Category = await axios
    .post("http://127.0.0.1:8000/webKiosk/client/category/read/", {
      market_name: "S",
    })
    .then((response) => {
      console.log(response.data);
    });
};
export default CategoryList;
